import React from 'react'
import './Header.css'
import logo from '../logo.svg'

const Header = () => {
    return (
        <header>
            <div className="siteName">howToBeFat.com</div>
            <div className="slogan">Eat, keep home and pet your cat !</div>
            <img src='../logo.svg'></img>
        </header>
    )
}

export default Header
